import React from 'react';
import {News} from './News.js';
import {Add} from './Add.js';
import {Home} from './Home.js';
export class MS extends React.Component {
    render(){
    return (

      <div className="App">


        <div>
         <Home/>
        </div>
        <div>

        <div class="mb-3">
  <label for="exampleFormControlInput1" class="form-label"><h5>Name</h5></label>
  <input type="email" class="form-control" id="exampleFormControlInput1" placeholder="Enter Your Name here!" width="100"/>
</div>
<div class="w-75 p-3" style="background-color: #eee;">
  <label for="exampleFormControlTextarea1" class="form-label"><h5>Description</h5></label>
  <textarea class="form-control" id="exampleFormControlTextarea1" rows="3"></textarea>
</div>


        </div>
        <div>
          <Add/>
        </div>
       <div className='button'>

       <a href="/News">Click here for Trendy Newz</a>
       </div>

      </div>

    );
  }
}

  export default MS;
